@lru_cache(maxsize=None)
def resolve_feedname(symbol):
  for feednamec in c:
    if symbol in c[feednamec]:
      if isContinuous(symbol):
        feednamec = '{}_continuous'.format(feednamec)
      return feednamec

  tokens = symbol.split('_')
  if len(tokens) > 0:
    for feednamec in c:
      if tokens[0] in c[feednamec]:
        if isContinuous(symbol):
          feednamec = '{}_continuous'.format(feednamec)
        return feednamec
